import React from 'react';

const Tabs = ({ selectedCategory, onSelectCategory }) => {
  const categories = ['somsa', 'other'];

  return (
    <div>
      {categories.map(cat => (
        <button
          key={cat}
          onClick={() => onSelectCategory(cat)}
          style={{ fontWeight: selectedCategory === cat ? 'bold' : 'normal' }}
        >
          {cat}
        </button>
      ))}
    </div>
  );
};

export default Tabs;
